"use strict";

const fs = require("fs");
const path = require("path");
const utils = require("../utils/index");

const MusicApp = {};

MusicApp.hello = function () {
  return '<sound collabId="" name="sound" sound="data:audio/wav;base64," id="1"/>';
};

MusicApp.listSounds = function () {
  var audio_path = path.join(__dirname, "YG_WEST_COAST_HIP_HOP_STRINGS_1.mp3");

  // read image file
  return new Promise((resolve, reject) => {
    fs.readFile(audio_path, (err, data) => {
      // error handle
      if (err) {
        throw err;
      }
      utils.sendAudioBuffer(this.response, data);
      resolve();
    });
  });
};

module.exports = MusicApp;
